  const [selectedChat, setSelectedChat] = useState({
    id: "",
    picture: "",
    first_name: "",
    last_name: "",
  });
  return (
    <div className="chat_container">
      <div className="chat_wrapper">
        <div className="chat">
          <ContactBox />
          <ChatBox />
        </div>
      </div>
    </div>
  );
}
